import React from 'react';
import heroImage from '../../assets/hero-image.png';

const Home = () => {
  return (
    <div
      className="pt-10"
      style={{
        backgroundColor: '#C4B682'
      }}>
      <div className="mx-auto px-6 md:px-20 xxl:px-0 relative" style={{ maxWidth: '1100px' }}>
        <div className="flex justify-around w-full">
          <img src={heroImage} alt="" className=" -mt-8 h-auto" style={{ maxWidth: '50%' }} />
          <div className="w-1/2 flex max-w-40">
            <div className="flex-grow">
              <div className="grid place-items-center">
                <div>
                  <h1 className="font-semibold text-5xl leading-tight max-w-96 mb-5">
                    Where Beauty <br /> Meets Luxury -<br />
                    <span className="text-white">Sugar&apos;d Bare</span>
                  </h1>
                  <p className="max-w-40">
                    Indulge in expert sugaring and top-tier beauty services, all delivered with a
                    warm and welcoming touch.
                  </p>
                  <div className="grid justify-center pt-12">
                    <a href="#" className="flex">
                      <p className="text-xs underline font-semibold text-center mr-6">
                        View Services
                      </p>
                      {/* add animation to make button bounce */}
                      <button className="rounded-full bg-white h-9 w-9">x</button>
                    </a>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div className="absolute" style={{ top: 300, left: 100 }}>
          <p>5.0</p>
          <p>*****</p>
          <a href="#">
            <p>Google Reviews</p>
          </a>
        </div>
      </div>
    </div>
  );
};

export default Home;

